import React from 'react';

function Register() {
    return (
        <form name="login-form" className="verification">
            <h2 className="verification__title">Регистрация</h2>
            <input id="email-input" type="email" name="email" placeholder="Email" className="verefication__input" minLength="2" maxLength="40" required />
            <input id="password-input" type="password" name="password" placeholder="Пароль" className="verefication__input" minLength="2" maxLength="200" required />
            <button type="submit" className="verefication__submit-button" >Войти</button>
        </form>
    );
}

export default Register;
